const aggregateEvents = (events) => {
    console.log(events);
    const eventMap = {}
    events.forEach(event => {
        const eventName = event.summary;
        console.log(typeof event.end)
        const time = event.end.getTime() - event.start.getTime();
        console.log(time);

        if (time in eventMap) { 
            eventMap[eventName] += time;
        } else {
            eventMap[eventName] = time;
        }
    });

    return eventMap;
}

export default aggregateEvents;
